+    <ResidentLayout>
+        <div className="flex flex-wrap flex-col justify-start mb-[12px] space-y-4">
+          {loading ? (<NoteP text="Loading.."/>): (
+            <>
+              <Header2 icon="/mshale.svg" text="Logged In Devices" callback={()=>navigate("/resident/settings")}/>
