+              {previous.length > 0 && previous.map((device) =>{
+                return <OtherDevice key={device.device_id} os={device.os} place={"Nairobi, Kenya"} time={getRe} browser={device.browser} callback={()=>logoutDevice(device.device_id)}/>
+              })}
+            </>
+          )}
+        </div>
+    </ResidentLayout>
+  );
+}
