                return <OtherDevice key={device.device_id} os={device.os} place={"Nairobi, Kenya"} time={} browser={device.browser} callback={()=>logoutDevice(device.device_id)}/>
              })}
            </>
          )}
        </div>
    </ResidentLayout>
  );
}
